import React from 'react';
import {
    DataTable,
    TableContainer,
    Table,
    TableHead,
    TableRow,
    TableExpandHeader,
    TableHeader,
    TableBody,
    TableExpandRow,
    TableCell,
    TableExpandedRow,
  } from "carbon-components-react";

const ItemList = ({ rows, headers }) => {
    return (
        <DataTable
        headers={headers}
        rows = {rows}
        render={({
          headers,
          rows
        }) => (
        <TableContainer>
            <Table>
                <TableHead>
                    <TableRow>
                        <TableExpandHeader/>
                        {headers.map((item) => (
                            <TableHeader>
                                {item}
                            </TableHeader>
                        ))}
                    </TableRow>
                </TableHead>
            </Table>
        </TableContainer>
        )}
      />
    );
}

export default ItemList
